//import lib
import React from 'react';

//create a component
const ContactList = ({contacts}) => {
    if (!contacts){
        return <div>Loading...</div>;
    }
    console.log(contacts)
    const listOfContacts = contacts.map(contact => {
        return (
            <ul>
                <li>contact</li>
            </ul>
        );
    })

    return <div>{listOfContacts}</div>;
}

//export a component
export default ContactList;
